import './App.css';
import LandingPage from '../components/LandingPage/LandingPage'
import ClaimPage from '../components/ClaimPage/ClaimPage';
import LeavePage from '../components/LeavePage/LeavePage';
import PayPage from '../components/PayPage/PayPage';
import { HashRouter as Router, Route } from 'react-router-dom'

function App() {
  return (
    <Router>
      <Route path='/main' component={LandingPage}></Route>
      <Route path='/payslip' component={PayPage}></Route>
      <Route path='/claim' component={ClaimPage}></Route>
      <Route path='/leave' component={LeavePage}></Route>
    </Router>
  );
}

export default App;
